import React, { Component } from 'react';
import Carousel from 'nuka-carousel';

export default class Document extends Component {
  render() {
    return (
      <Carousel>
        <img width={500} height={500} alt="900x500" src="assets/1.jpg" />
        <img width={500} height={500} alt="900x500" src="assets/2.jpg" />
        <img width={500} height={500} alt="900x500" src="assets/3.jpg" />
      </Carousel>
    );
  }
}
